import React, { useContext } from 'react'

import { useState, useRef, } from 'react'

import { Stack, InputLabel, MenuItem, OutlinedInput } from '@mui/material'
import Select, { SelectChangeEvent } from '@mui/material/Select';



const genes = [
    'ABC', 
    'EFG',
    'pop', 
    'XYZ'
]

export const Graph = () => {

    console.log('YES')
    const [geneName, setGeneName] = useState<string[]>([])

    const handleChange = (event: SelectChangeEvent<typeof geneName>) => {
        const {
          target: { value },
        } = event;
        setGeneName(
          // On autofill we get a stringified value.
          typeof value === 'string' ? value.split(',') : value,
        );
      };

    return (
        <Stack>
            <InputLabel>Gene</InputLabel>
            <Select 
              multiple
              value={geneName}
              onChange={handleChange}
              input={<OutlinedInput label='Gene'/>}
            >
                {genes.map((name)=>(
                    <MenuItem
                     key={name}
                     value={name}
                    //  style={}
                    >
                        {name}
                    </MenuItem>
                ))}
            </Select>
        </Stack>



    )


}
